INSERT INTO `institutions` (`id`, `name`, `description`, `location`, `level_field`, `logo`, `cover_photo`, `affiliated`, `usertype`) VALUES
(1, 'User Institution', 'A new institution not yet on the platform.', '', 'institution', NULL, NULL, 0, 1),
(3, 'University of Nairobi', 'The University of Nairobi (UoN) is a collegiate research university based in Nairobi. It is one of the largest universities in Kenya. Although its history as an educational institution dates back to 1956, it did not become an independent university until 1970. In this year, the University of East Africa was split into three independent universities: Makerere University in Uganda, the University of Dar es Salaam in Tanzania, and the University of Nairobi.\nDuring the 2011 academic year, the university had 61,912 students, of whom 49,488 were undergraduates and 12,424 postgraduates. The university launched several policy frameworks and introduced self-funded enrollment (also called \'\'module 2\'\') to cope with the rising demand for higher education in Kenya. ', 'Nairobi', 'Institution', '1.jpg', 'bg1.jpg', 1, 1),
(4, 'Ashleys Hair and Beauty Academy ', 'Ashleys School of Fashion and Design offers you an opportunity to train as a professional fashion designer. Fashion design is the art of application of design and aesthetics or natural beauty to clothing and accessories. Fashion design is influenced by cultural and social latitudes, and has varied over time and place. Ashleys Hair and Beauty Academy offers courses in hairdressing, massages, manicures and pedicures among others. \nIn all the top salons countrywide, you will find the best hair designers, beauticians and barbers are our graduates. Some are also working within East and Central Africa and abroad.  We have trained over 20,000 students of whom 90% are working in various Top Salons, Barbershops, Five Star Hotels and in other related industries.  We also offer fashion and design classes through our Ashleys School of Fashion and Design.', 'Nairobi', 'Institution', '2.jpg', 'bg2.jpg', 1, 1),
(5, 'Buruburu Institute of Fine Arts', 'Buruburu Institute of Fine Arts ( BIFA) was established in 1993 under the management of the Blessed Sacrament Catholic Church, Buruburu. It provides an ideal development opportunity in the world of Art and Design.\n\nOur mission is to effectively train in order to develop God given creativity and Innovation.\n\nWe are a tertiary training centre for art and design\n\nWe are located in Buruburu Phase III opposite the Blessed Sacrament Catholic Church and Thomas Burke Primary school.', 'Nairobi', 'Institution', '3.jpg', 'bg3.png', 1, 1),
(6, 'Daystar University', '', 'Nairobi', 'Institution', NULL, NULL, 0, 1),
(8, 'Multimedia University of Kenya', 'The Multimedia University of Kenya is a state owned university. It was established by the Kenya Government under Legal Notice Number 155 of 2008 as a constituent college of Jomo Kenyatta University of Agriculture and Technology (JKUAT) and later granted university charter on 1st March 2013 makng is one of the fully fledged Universities in Kenya.\n\nMultimedia University of Kenya Main Campus is located in a serene environment 25 Kilometres south of Nairobi along Magadi road, a kilometre away form Ongata Rongai town. The campus stands on 115 ha of land adjacent to Nairobi National Park. Currently the Multimedia University of Kenya offers degree and diploma programmes in Engineering, Computer Science and Information Technology, Business, Media and Communications Studies. Besides training MMU has distinguished itself as a major conference centre with few equals in this region. On average over 200 corporates including Government, Private and NGOs interact with MMU annually.', 'Nairobi', 'Institution', '8.jpg', 'bg8.jpg', 0, 1),
(9, 'Evelyn College of Design', 'Evelyn College of Design was founded in 1976, the first ever college of design in East and Central Africa. Over the years it has graduated thousands of students, who are to be found in all corners of the globe. The student population is diverse and has attracted the best. Faculty members are also leaders in their field, and the college remains the premier regional design institution, with an un-paralleled reputation.', 'Nairobi', 'Institution', '9.jpg', 'bg9.png', 1, 1),
(10, 'Talanta Institute', 'Talanta institute (formerly Princecam Media Institute) was conceived to expand from solely\noffering media related courses to include other fields of practical based training and develop\na talent nurturing centre.\nThe Institute now offers a wide array of courses in Hospitality and Tourism Management,\nMusic Writing, Performing Arts, Deejaying, Music Production, Radio Production, Baking\nand Cake Decoration, Event Management, Information Technology and Computer Studies.\nThe institute is keen on largely taking a practical approach to training It seeks to\ncomprehensively fill the training gap for technical and vocational training institutes in our\ncountry. This will give an unrivaled opportunity for people to pursue their talents and get the\nprofessional training, as well as offer visibility to talents on an upcoming platform known as\nTalanta Hub.', 'Nairobi', 'Institution', '5.jpg', '8e316b568dd90332293261365d32e899.jpg', 1, 1),
(11, 'Egerton University', '', 'Njoro', 'Institution', NULL, NULL, 0, 1),
(12, 'Great Lakes University of Kisumu', '', 'Kisumu', 'Institution', NULL, NULL, 0, 1),
