(16, 'Jomo Kenyatta University of Agriculture and Technology', 'Jomo Kenyatta University of Agriculture and Technology is situated in Juja, 36 kilometres North East of Nairobi, along Nairobi-Thika Highway.\n\nIt was started in 1981 as a Middle Level College (Jomo Kenyatta College of Agriculture and Technology (JKCAT)) by the Government of Kenya with the generous assistance from the Japanese Government. Plans for the establishment of JKCAT started in 1977. In early 1978, the founding father of the nation, Mzee Jomo Kenyatta donated two hundred hectares of farmland for the establishment of the college.\nThe first group of students were admitted on 4th May 1981. H.E. Daniel Arap Moi formally opened JKCAT on 17th March 1982. The first graduation ceremony was held in April 1984 with Diploma Certificates presented to graduates in Agricultural Engineering, Food Technology and Horticulture.The School of Architecture and Building Sciences (SABS) was established in February 2000. SABS brings together disciplines related to the built and natural environment in an attempt to address the commonly experienced problems in these fields. SABS consists of the following teaching departments:\n\nArchitecture\nLandscape Architecture\nConstruction Management\nCentre for Urban Studies', 'Nairobi', 'Institution', '16.jpg', 'bg16.jpg', 1, 1),
