(12, 'Resource centre BUILDINGS', 'This are various renders of the proposed University of Nairobi Resource center.It was great working on such an interesting and challenging project.', 'Various renders', 'I did  the project with the aim of teaching myself staff that our lecturer hadn\'t taught us.I used this project to compete at the United Nations Design Competitions which then enabled me to get internship at the UN Habitat.\r<br>I hope to do more of this projects as opportunities present themselves.', 1, 1, '2016-03-16 16:54:43'),
(16, 'Form and Aesthetics', 'The MUD has borrowed aspects of the streetscape within Moktar Dadah while introduced its own character to the \nelevation. The Islamic heritage of the building is still maintaine', 'Design approach', NULL, 1, 1, '2016-03-16 16:54:43'),
