(32, 'Top 40 under 40', 'I have been selected as one of the Top 40 under 40 women in Kenya! The youngest at 20 years old. I am truly humbled and elated. Thank you to the people who nominated me smile emoticon I had no idea un', 'Recognition of women efforts', NULL, 0, 2, '2016-03-16 16:54:43'),
(36, 'Designing of Kibera school project', 'This Design was a mock up of the proposed Kibera  school auditorium with a view of the surrounding landscape.\r<br>This project took me one week to complete its visualization,always exciting to work', '1.Do complete renders of the proposed site.\r<br>2. Use Photoshop to touch up the renders', 'Some of my friends who helped me complete the projects were\r<br>Anne Mwiriri.\r<br>Benerd momanyi.\r<br>Levis Njehia.\r<br>Tracy Maguta,\r<br>I also want to thank my lecturer Mr.Kigara for his invaluable input.', 1, 0, '2016-03-16 16:54:43'),
(40, 'Sports Center', 'This project is a proposed design for a sports center having a training field, locker rooms and seminar rooms', NULL, 'This project is made using ArchiCAD 17, Lumio 4.1 and editing done in Photoshop', 0, 3, '2016-03-16 16:54:43'),
(41, 'Apartment Building', 'An overview of apartment building in a trendy upscale location.', NULL, 'An overview of apartment building in a trendy upscale location. Complete with garden and parking. Views include the driveway, side elevations, day and night scenes.', 0, 2, '2016-03-16 16:54:43'),
(44, 'Cleaning up Kibera', 'I am happy to have taken part in cleaning up kibera together with the national youth service.', NULL, 'After volunteering to do many of this community clean up exercise.I was able to get a job as a supervisor at the National youth service.I encourage you to also continue volunteering,they pose many employment opportunities.', 0, 1, '2016-03-16 16:54:43'),
(58, 'Penthouse', 'A model of a simple trendy penthouse apartment with a marvelous view', NULL, 'I created this model with multiple floors giving adequate attention to detail on each floor. I used windows to improve the effect of natural lighting and give the opportunity for a marvelous view. It also enabled me to showcase the effect of lighting on the room in both day and night.', 0, 1, '2016-08-16 16:54:43'),
(85, 'Bangkok Travel photography.', 'I took this photographs when I traveled to Bangkok  for the Global Student Entrepreneurs Awards,an Entrepreneur\'s Organization event awarding the best student Entrepreneurs\' from each country.', '1.A typical Day in Bangkok.\r<br>2.The Bangkok skyline.\r<br>3.Travel photography.', 'I was interested more in the life and the breathtaking skyline of Bangkok city.The  average weather in the city is humid and warm.The city is more active at night since that is when the temperature is a bit cool.The city\'s main mode of transport if city train that spreads the entire city and \'\'scooter\'\' move people from one market t the other.The rich class of people use uber and Didi.Good place to be though.The photos are completely unedited.', 1, 0, '2016-08-16 16:54:43'),
(86, 'Cakes and burgers', 'Cake is a form of sweet dessert that is typically baked. In its oldest forms, cakes were modifications of breads but now cover a wide range of preparations that can be simple or elaborate and share fe', 'Although clear examples of the difference between cake and bread are easy to find, the precise classification has always been elusive.[3] For example, banana bread may be properly considered either a quick bread or a cake.', 'Typical cake ingredients are flour, sugar, eggs, butter or oil, a liquid, and leavening agents, such as baking soda and/or baking powder. Common additional ingredients and flavourings include dried, candied or fresh fruit, nuts, cocoa, and extracts such as vanilla, with numerous substitutions for the primary ingredients. Cakes can also be filled with fruit preserves or dessert sauces (like pastry cream), iced with buttercream or other icings, and decorated with marzipan, piped borders, or candied fruit.[1]\r<br>\r<br>Cake is often served as a celebratory dish on ceremonial occasions, for example weddings, anniversaries, and birthdays. There are countless cake recipes; some are bread-like, some rich and elaborate, and many are centuries old. Cake making is no longer a complicated procedure; while at one time considerable labor went into cake making (particularly the whisking of egg foams), baking equipment and directions have been simplified so that even the most amateur cook may bake a cake.', 0, 1, '2016-08-16 16:54:43'),
