(140, 'Gaita Website Launch', 'Launch of artist and DJ Gaita\'s new website. I made this website to help him market his brand', 'Get Site requirements e.g look and feel, sections, colours\r<br>Create mockups using Balsamiq\r<br>Design layout on Photoshop\r<br>Finalize with HTML, CSS, JavaScript', 'I did this site to promote the brand of my long-time friend Perminus Gaita who is a talented artist, DJ and producer. The process incolved getting to know the theme and feel of the site, creating several mockups using Balsamiq to play with designs.\r<br>\r<br>I then created a layout with images and colours using Photoshop which he agreed on. The next step was implementation of the psd into HTML, CSS and Javascript. I used Bootstrap, JQuery and slider plugins. The site was then hosted and launched in mid 2016. \r<br>\r<br>It was a great pleasure working with, and creating this site for Gaita. Check out his work on YouTube (Gaita) and Soundcloud (Gaita).', 0, 2, '2016-12-24 23:04:57'),
