(191, 'The Ariel View of Nairobi and the streets', 'This is  random photography I decided to take to compare and contrast what one sees from above and what one finds in deep the streets.', '1.Take photographs of CBD from Abiove.\r<br>2.Take photographs of the abandoned and dirty streets', 'Nairobi is a beautiful city when viewed form above,you will be surprised that the beauty is an illusion full of dirty streets,\'Chokoras\"roaming the streets hungry to have a piece of your sweat and so on.The city council seems not to be bothered by the situation considering that some of these dirty streets are the the backyard of the city county office.', 0, 2, '2016-12-24 23:04:57'),
