(212, 'New Year                   Graphic Design', 'New year posters and memes to celebrate the holiday season and wish your loved ones success.', 'Come up with a design concept\r<br>Generate the message to go with the design\r<br>Create the design mockup\r<br>Design using Illustrator\r<br>Finish up and polish the design', 'I came up with this design to help send holiday greetings from our team at Briglobe. I wanted a catchy, modern look to represent the feel of the team and spread the message of hope for the new year.\r<br> I did the mockup in Microsoft Visio then created the full design with Adobe Illustrator. I used the web color palette to achieve the same look and feel of the text and image. For the final image I used a transparency layer to enable the text take any color for its background.\r<br>I did three designs with one having 2 layouts. I then shared them out to social media.', 0, 3, '2016-12-24 23:04:57'),
