(358, 'Office Design.', 'It’s an unspoken rule that a fun company needs headquarters to match the fun.I mixed assigned workstations to create social hubs that encourage interaction across teams.', 'The design interventions take the form of thoroughly branded meeting rooms and a centrally located cafe on the first level, outfitted with both new and existing furniture. The cafe faces a stairway, surrounded by stepped reclaimed white oak seating, which ascends to more communal space above', 'Large-scale graphics that showcase the office  history—and trade secrets—serve double duty as wall covering. “The design fosters teamwork and synergy,” says Spector. “And with a history-rich company, it is essential that we create a space that couples the timelessness of the brand with modern office culture.', 0, 2, '2017-03-24 22:04:57'),
