(383, 'Renovated an apartment', 'A renovation project of a flat built in the early 1970s as a way to give it a new lease of life and bring it into the 21st century', 'To prove to the owners of what seemed like a dilapidated property that with a little attention to detail and a willingness to take a chance you can increase the value of the property by 10x', 'We took a 3 bedroom apartment that was initial built in the 1970s and renovated it with all the creature comforts of the day.\r<br>\r<br>The flat was one of those previous owned and managed by the Nairobi City Council and had over the years fallen into disrepair.  After the council failed to repay a 40 year old developed loan given to them by NHC, it was mutually agreed that the units be disposed off to raise funds for the payment of the loan.\r<br>\r<br>This was one of those poetic justice situations where the tenants who run the units into the ground where offered the opportunity to purchase them, for a long time their was an impasse as they insisted that the rent they had paid should be converted into payment for the units.\r<br>\r<br>The ludicrous argument was thrown out the window and the units were placed on the market at 1.8 million for a 2 bedroom and 2.1 million for a 3 bedroom, which in my opinion was a steal.\r<br>\r<br>We bought off one of this units from one of the tenants who did not see the true value in it, we then went out to turn it around and bring out its true value and that is what this project intends to achieve.', 0, 1, '2017-08-16 16:54:43'),
