(393, 'Royal court villas', 'The brief entailed modern houses in the outskirts of Nairobi University', 'To achieve an organised community around an irregular site', 'These are 3bedroom modern urban house villas for university staff. \r<br>The site was University of Nairobi College of health sciences. They are 8 units organised around a swimming pool, providing good views into the site. It also featured a club house with a gym and sauna.\r<br>There is also an ample parking for the residents, and also opening to outside as a way of giving back to the society.', 1, 3, '2017-08-16 16:54:43'),
