(400, 'Student Pin up', 'This is a digital format of some of our student pin ups done in the past year.', 'Present the work on a pin up board', 'A team of faculty and industry professionals will rate each exhibit. While rating exhibits on the basis of overall quality rather than individual categories, they will look for examples of the following:\r<br>\r<br>        Design process: Development of ideas, as well as two- and three-dimensional diagramming skills.\r<br>        Design resolution: Organizational skills in both two- and three-dimensions relating to spatial enclosure and circulation systems.\r<br>        Communication skills: Drawing quality (free-hand and hardline); three-dimensional drawings (axonometric, one-point and two-point perspectives); use of hierarchy in organizing information; and model-building skills.', 1, 2, '2017-08-16 16:54:43'),
(401, 'Portraits ', 'A photoshoot of my various clients done in school.', NULL, 'Portrait photography or portraiture is photography of a person or group of people that captures the personality of a subject by using effective lighting, backdrops, and poses.A portrait picture might be artistic, or it might be clinical, as part of a medical study Frequently, portraits are commissioned for special occasions, such as weddings or school events. Portraits can serve many purposes, from usage on a personal Web site to display in the lobby of a business', 1, 2, '2017-08-16 16:54:43'),
(402, 'Student crafts', 'Multi-media crafts is a course that encompasses all other areas of fine art requiring the use of many materials, using special skills to make artifacts by hand.', NULL, 'units include:-\r<br>\r<br>Mosaic making\r<br>\r<br>Collage Making\r<br>\r<br>Jewelry and Ornamentation\r<br>\r<br>Weaving and Leather work\r<br>\r<br>Laboratory Techniques', 1, 2, '2017-08-16 16:54:43'),
(403, 'Product Design', 'Product Design cultivates the technical and critical skills you need to design products that enhance human abilities and relationships.', NULL, 'In this major, you address contemporary realities including sustainability and technological change while exploring materials, fabrication, aesthetics, and social engagement in both local and global contexts.', 1, 2, '2017-08-16 16:54:43'),
(404, 'Office space deign', 'This desk design was done as one piece of an full office redesign.', NULL, 'I began my process of design knowing I wanted to come up with a modular desk that would be able to link together in numerous formations and would conserve space dimensionally, as well as something that could be made as standardized units for standard renting rates. \r<br>\r<br>I noticed as I sketched that some shapes created ‘closed loop’ configuration, while others could be pieced together endlessly. The second was what I preferred, as it had a higher potential for growth and flexibility.\r<br>\r<br>The final shape accomplished all of my desired attributes, as well as becoming a pattern that inspired nature and plants which is the main theme behind my overall scheme.', 0, 2, '2017-08-16 16:54:43'),
(405, 'Omarion254', '', '', 'If I were to describe concert photography in one word, that would definitely be timing. Both good and bad timing will greatly determine whether or not you\'ll get your money shot. You have to be at the right place, at the right time.\r<br>This project needed 101% concentration and a study of the artist as you have to almost, just almost, predict his or her next move. Another technique highly utilized in such cases is known as \"burst\" - this basically means, you don\'t have time to take a photo and immediately look at it, you just keep pressing that shutter button (a burst), and then, go through the images later. This ensures you essentially don\'t miss not even a single piece of the action.\r<br>Obviously, some shots won\'t be so appealing, some will be completely blurry and whatever other wrong thing that could possibly go wrong in a photo. But, you\'d rather have a not-so-good shot (which can be fixed), than no shot at all.\r<br>I did not have earplugs; and this is one of the most crucial things you ought to have during any concert, lest your ears bleed (in the extreme case) or go home with an overly sensitive ear, like myself. And extremely painful and sensitive my left ear was indeed. All in all though, I went home with even more than I\'d expected; photos to show, lessons learnt and an experience never to forget. The project was worthwhile, and for that I\'m grateful.', 0, 2, '2017-08-16 16:54:43'),
(406, 'Kibiko Mansions', 'Dreamt about owning your family home in the tranquillity of a prestigious leafy suburb ? visualize no further ! Our spacious 5-bedroom splendor with lush garden.https://goo.gl/daTm99', 'Learn new tools.', NULL, 0, 4, '2017-08-16 16:54:43'),
