(409, 'City Skyline', 'When we talk about cityscape photography, one of the most basic and trademark shots is the full skyline; the artificial horizon, made of buildings and towers jutting up and down into the sky above. Sk', NULL, NULL, 0, 1, '2017-08-16 16:54:43'),
(412, 'interior works', 'This is a space that I did for a client who needed mock ups of his country house.', 'A full interior design concept of an upcountry home.', 'When designing the interior of a country house,its really important to understand what kind of feel the client needs to have once he/she settles down.I do my work based on that,to capture the feel that my clients want.', 0, 2, '2017-08-16 16:54:43'),
(413, 'interior works', 'This room already had good bones: great size and balanced proportions with wonderful features like gorgeous dark hardwood floors, timber beamed ceilings and a window flanked with built-in cabinetry th', NULL, 'The mood or feeling of a room is created by your choice of colors, the style of furnishings, the amount of texture and pattern you choose and your accessories. Since there\'s so much to think about when creating a mood, establishing a theme through the selection of an inspiration piece can make this portion of a decorating project much more fun and interesting.', 0, 4, '2017-08-16 16:54:43'),
(414, 'Interior design works', 'A beautifully decorated interior not only functions well but it creates a mood or a feeling and shows off the personality of the family that lives there.', NULL, 'Sometimes rooms have natural focal points (places the eyes travel to immediately upon entering a room) — a fireplace, a bay window with a view, maybe even a built-in bookcase. If the room doesn\'t have a natural focal point, I create one with a dynamic piece of art or a colorful area rug.', 0, 4, '2017-08-16 16:54:43'),
