(426, 'JIDENNA IN NAIROBI', 'This Classic Man, this guy from the Let Out and a worldwide fashion sensation of a man, performed in Nairobi, Kenya at the Carnivore grounds and I wasn\'t going to miss it. Take a look and see why.', 'Get plenty of money-shots.', 'Jidenna is one of the most playful performers you\'ll ever get to watch. It\'s just too entertaining. From minute one to minute last.And he doesn\'t need any help doing so.\r<br>This event was a bit different from the one I spoke of previously (Omarion254) in that I did not use my speedlite much. Here\'s why.\r<br>The venue didn\'t have much of tent cover so no place/area above me for the speedlite\'s light to bounce off from. I panicked a bit, as I arrived at the grounds relatively early and that\'s the first thing I couldn\'t help but notice. Such events are an automatic for a speedlite but such scenarios demand another set of \"expertise\" as you have to use the big spotlight that always follows the artiste on stage, to get your shots right. I got the hang of it quickly (thank God) and the fear faded away as the show went on. I\'d encourage anyone that shoots concerts to invest heavily in a camera whose ISO can go really high so that such issues don\'t particularly worry you.  The VIP area had (obviously) several tents pitched, making portraiture easily achievable. I thank God it didn\'t rain. Coz that might have just been disastrous, to say the least. But don\'t get me wrong though, I don\'t hate rain, I just don\'t like the idea of rain on such occasions. The night was a good one. The experience an even better one, the shots, even sweeter. We thank FOMO Party Kenya and Privee for making it all a success - the after party was held at Privee and yes, Jidenna did show up...wearing white tho.\r<br>I\'d also love to add that Jidenna wished Kenyans a peaceful elections somewhere in the middle of his performance. Courteous.', 0, 3, '2017-08-16 16:54:43'),
