(472, 'Photography', 'Our vision is to see Kenya grow into a beautiful, peaceful and vibrant country. Let us not fight against each other due to our ethnic differences or opinions, but rather fight for peace to prevail amo', NULL, 'Concept: AM KENYAN\r<br>MUA: Anna Montez Beauty\r<br>Project members: Ann Gacheru,Stephen Maithya ,Alloys Iteba, Urban Visuals, Claudia Mokua, Said Myke, Michael Ogochi.', 0, 4, '2017-10-16 16:54:43'),
(473, 'Concept Photography', 'This project is a collaborative project entitled “AM KENYAN”. The aim of the project was to foster peace, love and unity amongst us as kenyans, and especially during this time of elections.', NULL, 'We want to preach against violence and foresee unity amongst us and a peaceful and vibrant country. Love should define us and not ethnicity.\r<br>\r<br>We are one Kenya.', 0, 4, '2017-10-16 16:54:43'),
