(526, 'Web Design Project                       Sabian Creative', 'Sabian Creative is a single page website template designed by  myself to be as simplistic and beautiful at the same time . This website can mainly be used as a portfolio website or customized to meet ', 'To integrate mobile responsiveness of website\r<br>To design beautiful websites from scratch\r<br>Integration of bootstrap', 'Sabian Creative is a single page website template designed by  myself to be as simplistic and beautiful at the same time . This website can mainly be used as a portfolio website or customized to meet ones needs.', 0, 2, '2017-10-16 16:54:43'),
