(528, 'Web Design Project : Sabian Corporate', 'Sabian Corporate is a business website template meant to be used mainly for businesses. The template comes with features like Revolution Slider, Owl Carousel, Layer Sliders e.t.c. Here is the <a href=', 'Mobile Responsiveness of websites', 'Sabian Corporate is a business website template meant to be used mainly for businesses. The template comes with features like Revolution Slider, Owl Carousel, Layer Sliders e.t.c. Allows for portfolio grids, blogging integrated with advanced features meant to make it even more impressive. Feel free to drop a mail if you need custom website templates like this designed for you by yours truly', 0, 2, '2017-10-16 16:54:43'),
(529, 'Mobile Application Project : Shapes', 'Shapes Collections is a mobile application that aims to ease access of your favorite clothes and accessories at the comfort of your mobile phone.', 'Ease of shopping through mobile applications\r<br>Automation of payment processes', 'Shapes Collections is a mobile application that aims to ease access of your favorite clothes and accessories at the comfort of your mobile phone. Isaac Isamawa, a business owner, saw it fit to upgrade his business by integrating technology. This was a smart move on his part and what was even smarter was his choice of the developer. Me. He needed a website that would allow him to publish some of his products and allow users to order them through the site. To take it a step further, he wanted a mobile application that would be seamlessly connected to the site thus allowing users to view and order for products through the mobile application as well. This is where I stepped in and now, thanks to technology, business has been booming. According to him of course.\r<br>\r<br>The mobile app fetches data from the site through an API Integration that allow for data exchange between the server and the mobile app. Here is a link to the play store <a href=\"https://play.google.com/store/apps/details?id=com.sabianshopper\">Shape Collections</a>', 0, 2, '2017-10-16 16:54:43'),
(530, 'Mobile Application Project : Sabian Reader', 'Sabian Reader is a mobile application that allows users to browse, purchase and read books at the comfort of their mobile phones', 'To allow users to read books from their phones\r<br>To automate the payment process', 'Sabian Reader is a mobile application that allows users to browse, purchase and read books at the comfort of their mobile phones. This mobile app is mainly targeted for book worms like myself that are always on the move but still desire to quench their thirst for books without dragging large book volumes wherever they go. \r<br>The mobile app is integrated with an online application that allows administrators to publish books  and book files. The app allows users to make purchases of these books through various payment gateways like Paypal, Visa Card and most importantly, MPESA. Impressive right? Wait till you acutally use it for yourself.\r<br>\r<br>So no more carrying mountainous book volumes. Sabian Reader is here for you. Here is a link to the play store <a href=\"https://play.google.com/store/apps/details?id=com.gurustor\">Sabian Reader</a>', 0, 3, '2017-10-16 16:54:43'),
