(547, 'FileManager App', 'An android app to  Create,read,delete,append and encrypt files on internal or external disk space', 'The main objective of this project is to showcase and improve mastery of my android coding skill .The app is easy to use and has a clean user interface backed by material design.', 'Create,read,delete,append and encrypt files on internal or external disk space.FileManager simplifies the actions you perform on files on your phone.\r<br>\\rFeatures\r<br><br><br><br><br>    Easy define Internal or External storage\r<br><br>  Create directory\r<br><br>< Create file\r<br><br>  Read file content\r<br><br><br><br><br>    Append content to file\r<br><br><br><br><br>    Copy\r<br><br><br><br><br>    Move\r<br><br><br><br><br>    Delete directory\r<br><br><br><br><br>    Delete file\r<br><br><br><br><br>    Get files\r<br><br><br><br><br>    More options\r<br><br><br><br><br>    Encrypt the file content              \r<br><br><br><br>The link for the app on Google play is             https://play.google.com/store/apps/details?id=ck.the.filemanager', 0, 2, '2017-10-16 16:54:43'),
