(550, 'AppMaster', '', NULL, 'AppMaster  is a customizable APK manager for Android: extract any installed app, mark them as favorite, share .apk files easily and much more.\r<br>\r<br>Meet the easiest app manager and extractor with Material Design on Android.\r<br>\r<br>Features:\r<br>• Extract any installed & system apps and save them as APK.\r<br>• Batch mode to extract multiple APKs at the same time.\r<br>• Share any APK using other apps: Telegram, Dropbox, email, etc.\r<br>• Share any APK using Bluetooth.\r<br>• Organize your apps by marking them as favorite and access them easier.\r<br>• Upload your latest APKs to Whatsapp,Facebook,APKMirror.\r<br>• Uninstall any installed app.\r<br>• Customizations available in Settings, including a dark mode, customizing main colors and more.\r<br>• No Root access required.\r<br>Disclaimer\r<br>The app uses source code from MLManager which is licensed under the Apache License.', 0, 1, '2017-12-24 23:04:57'),
