(802, 'Face of Stevenchy ', 'You don\'t fall in love with the body, you fall in love with the soul, and once in love with the soul, everything about that body becomes beautiful.\r<br>Appreciating a woman\'s true splendor and beauty.', NULL, 'Creative direction/ Photographed by: Stephen Maithya\r<br>Production company: Stevenchy Photography\r<br>Model: Jacintaharts Njeri, Face of Stevenchy Photography: 2017-2018\r<br>MUA: The gifted Zena Glam Make-Up\r<br>#kenyan #fineartphotographer\r<br>Location assistant: Eric Machira\r<br>Location manager: Mary Achola', 0, 4, '2017-12-16 17:54:43'),
