(806, 'Devils Dream', '\"I will give you this fruit and bear the blame and consequences on my shoulders on your behalf, only in one condition, \"', NULL, '\"I will give you this fruit and bear the blame and consequences on my shoulders on your behalf, only in one condition, \" Lucifer did not hesitate to employ his cunningness, \" that you share this fruit with your husband, so that both of you may become like God, and share in his heavenly glory.\"\r<br>Concept: DEVIL\'S DREAM -series-\r<br>Production company: Stevenchy Photography\r<br>Creative director/ concept/ story/ photographer: Stephen Maithya\r<br>Starring: Steven Stowel as LUCIFER and Jacinta Njeri as EVE\r<br>Make up by: Zena Glam Make-Up\r<br>Location Manager: Mary Achola', 0, 4, '2017-12-16 17:54:43'),
(807, 'The country we love', 'We must guard against a weakening of the values that make us who we are ~Barack Obama', NULL, 'As we approach the repeat election day, let us put in mind that Kenya is a great country with all of us united. Let us exercise our democratic rights peacefully, forever shunning out the demon of conflict and embracing the angel of peace.\r<br>\r<br>Creative direction/ concept/ photographer: Stephen Maithya\r<br>Production company: Stevenchy Photography\r<br>Model: Dennis Oludhe\r<br>MUA: Royce Wallace & Zena Glam Make-Up\r<br>Dressing: Hause Valeriaa\r<br>Location assistant: Eric Machira\r<br>Location manager: Mary Achola', 0, 4, '2017-12-16 17:54:43'),
(808, 'Devils Dream 3', 'And after a long exposure to a jostling mind, a brilliant idea struck him. He gazed at the apple and boomingly laughed his heart out', NULL, 'Long before the creation of mankind, God created superficial beings to help him govern heaven and the earth and worship him. Among the celestial beings he created was the archangel Lucifer, head of the music ministry in heaven, the most beautiful and highest of all the angels. With time, Lucifer\'s heart became filled with pride, and soon after he started to desire God\'s throne all for himself. He convinced a few angels to take his side and help him proclaim the throne, and as a result, war broke out in heaven. Defeated, Lucifer was cast out of heaven, and like lightning, he fell from the sky, along with all the angels that had sided with him. Angered, Lucifer set to destroy the one creation that God loved the most: MANKIND.\r<br>\r<br>                                And after a long exposure to a jostling mind, a brilliant idea struck him. He gazed at the apple and boomingly laughed his heart out. His vision became clear to him now. Then,for a moment, he fell into a small fantasy.\r<br>\\r\r<br><br>PART 3\r<br><br>Concept: DEVIL\'S DREAM-series-\r<br><br>Creative director/ concept/ story/ photographer: Stephen Maithya\r<br><br>Production company: Stevenchy Photography\r<br><br>Starring: Steven Stowel as LUCIFER\r<br><br>MUA: Zena Glam Make-Up\r<br><br>Location assistant: Eric Kenani Machira\r<br><br>Location manager: Mary Achola', 0, 3, '2017-12-16 17:54:43'),
