(879, 'Photography for Chrome Invasion Bash Featuring Diamond Platinum', 'Tanzanian Star Diamond Platinumz  closed out 2017 in style right here in the 254.\r\n\r\n', 'Do the official photography for the Chrome Invasion Party event.', '<p><span style=\"color: rgb(64, 64, 64); font-family: &quot;Roboto Condensed&quot;, sans-serif; font-size: 16px;\">Throughout the year<b> Chrome Vodka parties</b> have gone down in Nairobi, Nakuru, Kisii and Thika and now Chrome Vodka want to present the New Year experience.</span></p><p><font face=\"Roboto Condensed, sans-serif\"><span style=\"font-size: 16px;\"><b style=\"color: rgb(64, 64, 64); background-color: rgb(107, 165, 74);\">The Belaire ambassador</b><font color=\"#404040\"> has collaborated with various International Artists with the latest one being with </font><span style=\"color: rgb(64, 64, 64); background-color: rgb(107, 165, 74);\">Rick Ross</span><font color=\"#404040\"> on the jam “Waka”, another banger was with </font><span style=\"background-color: rgb(8, 82, 148);\"><font color=\"#ffd663\">Morgan Heritage</font></span><font color=\"#404040\">, ‘Hallelujah’ and a host of other bangers that can keep him on stage for two hours.</font></span></font><br></p><p><span style=\"color: rgb(64, 64, 64); font-family: &quot;Roboto Condensed&quot;, sans-serif; font-size: 16px;\">I was glad to have been chosen as the official photographer for the event.<br></span><br></p>', 0, 4, '2018-01-05 09:12:01'),
(880, 'Eazy Party Mobile App', 'Ezyparty is a market place for events and artists.', 'The platform required a mobile application for the user end and a web portal to manage the backend of the system.', '<p>My client needed <i><span style=\"background-color: rgb(181, 214, 165);\">a mobile app that enables entertainers market their services to event organisers.</span> </i>This was to make it easy for the two parties find a c<b>ommon platform </b>to find each other.It has since helped Musicians find <i style=\"\"><b>gigs</b> </i>and given consumers the <b><i>power to reach</i></b> any entertainer within <b style=\"\">Nairobi and Kenya</b><i style=\"text-decoration-line: underline;\"> </i>at large at the touch of a button.</p><p><u><span style=\"font-size: 18px;\">Some of the people using the Eazy party platform at the moment </span><a href=\"include:-\"><span style=\"font-size: 18px;\">include:-</span></a></u></p><ol><li>DJs</li><li>Musicians</li><li>Cartoonists</li><li>Photographers</li><li>Videographers</li><li>Event organisers</li><li>Drink distributors</li><li>Comedians.</li></ol><p><br></p>', 0, 4, '2018-01-05 18:05:09'),
(881, 'Inversk Magazine Mobile App', 'Inversk is a digital media company dedicated to plant the seed of entrepreneurship to highly ambitious people through its digital Magazine.', 'Build a mobile app from the ground up that delivers content to inversk users on a daily basis.', '<p><span style=\"color: rgb(34, 34, 34); font-family: georgia, palatino, serif; font-size: 18.6667px; text-align: center;\">Every month <b><i><a href=\"http://www.inversk.co.ke\" target=\"_blank\">INVERSK</a></i></b> delivers a digital magazine to your email. This Issue features feature stories and advice from the most successful entrepreneurs and industry experts. The magazine also captures StartUp stories, business advice, actionable personal development advice, and growth strategies that you can apply to improve your life and build your business.</span></p><p><span style=\"color: rgb(34, 34, 34); font-family: georgia, palatino, serif; font-size: 18.6667px; text-align: center;\"><i>Inversk\'s mission is to nurture and promote Startup founders and entrepreneurs by sharing actionable business and personal growth strategies that will train them on how to build better lives and successful businesses.</i></span><span style=\"color: rgb(34, 34, 34); font-family: georgia, palatino, serif; font-size: 18.6667px; text-align: center;\"><br></span><br></p>', 0, 4, '2018-01-05 18:43:26'),
(882, 'Vospine social Network Mobile App', 'VoSpine is an interactive platform connecting people with similar interests.', 'The needs of the platform were a dynamic mobile application and web application like other social media sites for the users and a dynamic backend site for the management of the entire system.', '<p><span style=\"color: rgb(51, 51, 51); font-family: Verdana, Arial, Helvetica, sans-serif; font-size: 12.8px; text-align: justify;\"><u><b><a href=\"http://VoSpine.com\" target=\"_blank\">VoSpine</a></b></u> is a networking site that is aimed at ensuring <b><i>only relevant content reaches the relevant people</i></b>. At times we, as users of other networking sites are irked by the posts we see from other users on social sites. For instance, a friend may post content on maybe fashion and if you have no particular interest in fashion, you’ll find this inappropriate.</span></p><p><span style=\"color: rgb(51, 51, 51); font-family: Verdana, Arial, Helvetica, sans-serif; font-size: 12.8px; text-align: justify;\"><br></span><span style=\"color: rgb(51, 51, 51); font-family: Verdana, Arial, Helvetica, sans-serif; font-size: 12.8px; text-align: justify;\">Users join particular channels where they are able to <i><b>share their knowledge and experiences</b></i> with other people across the world with whom they share <u><i><b>common interests.</b></i></u></span></p><p><span style=\"color: rgb(51, 51, 51); font-family: Verdana, Arial, Helvetica, sans-serif; font-size: 12.8px; text-align: justify;\"><u><i><b><br></b></i></u></span><br></p>', 0, 4, '2018-01-05 19:14:42'),
(883, 'Sportspewa Mobile app', 'This is a promotional application for brands.', 'Build a mobile app that uses codes to credit users cash to their betting accounts in various betting sites.', '<p class=\"MsoNormal\"><span lang=\"EN-US\">The needs were a mobile application to\r\neasily manage the processes for the <b>sportspewa </b>promotional algorithm.</span></p><p class=\"MsoNormal\"><span lang=\"EN-US\"><o:p></o:p></span></p>', 0, 4, '2018-01-05 19:22:59'),
(884, 'Mealtime Mobile Application', 'Mealtime is a food ordering app which enables consumers order affordable meals  from restaurants around them.', 'I was tasked to build an app from the ground up that makes it so easy to order food which a customer can afford while offering a great user experience.', 'The system includes an android application for users available on Google Play store as MealTime Kenya (https://play.google.com/store/apps/details?id=com.mealtime&hl=en ), a web application and another android application whereby the restaurants and other food vendors can easily upload their menus and dynamically change their prices which reflect instantly on the customers end. They are also able to receive the customer orders with their exact locations.\nWe also built the website for MealTime Kenya accessible at https://mealtime.co.ke/ \n\nThe Application is available in \n1.USSD\n2.Messanger Bot.\n3.Telegram Bot.\nWhatsapp Bot.', 0, 4, '2018-01-05 19:36:03'),
(885, 'Ewash Mobile Application', 'eWash is a platform connecting laundry service providers with people seeking the services. ', 'Build an app from the ground up  that enables users order laundry services on demand via a mobile app.', 'The platform required a user end application and a backend management application for the laundry services providers to easily view incoming requests including the user location.\nThe user application is accessible on play store at https://play.google.com/store/apps/details?id=com.ewash&hl=en \n', 0, 4, '2018-01-05 19:57:13'),
