(891, 'Personal and Clients projects -4th Quarter 2017', 'This is a collection of projects that i did between August to December 2017.The project includes logos,posters and photomanipulation', 'My personal projects aim at testing concepts that i have in mind.There usually feature photo manipulation .\r\nFor client\'s projects the aim is to satify the client\'s expectations', 'PRICING\r\n1.Logo 1000 -10,000 depending with client\'s demands\r\n2. Posters 500 -3000 /=\r\n3.Business card 500/=\r\n4.Photo manipulation 200/=\r\n5.Printing photo manipulation art on canvas 2000- 4000 depending on size', 0, 4, '2018-01-07 09:16:45'),
(895, 'Personal  & Clients projects  (4th Quarter 2017)', 'This is a collection of projects that i did between August to December 2017.The project includes logos,posters and photomanipulation', 'My personal projects aim at testing concepts that i have in mind.There usually feature photo manipulation .\r\nFor client\'s projects the aim is to satify the client\'s expectations', '<p><u>PERSONAL PROJECTS</u></p><p><i>1.Cece Sagini</i></p><p><i>This photomanipulation is designed to showcase the magic of the african landscape with an african face.I used Cece Sagini\'s face with Maasai ornaments for this project</i></p><p><i>2.Angel Mbuthia\'s African pride</i></p><p><i>This is a dispersion project involving a human face and the Kenyan Flag.Kwame nkhrumah\'s quote on african pride features in the image.</i></p><p><i>3.Feathers,leaves and water dispersion projects</i></p><p><i>This are generally experimential projects.</i></p><p><i>CLIENTS PROJECTS</i></p><p><i>1.Logo for Kenas Treats</i></p><p><i>This client wanted&nbsp; a unique logo for her bakery and i gave her just that.</i></p><p><i>2.Logo for Balti constructions,Inspiring footprints non profit organisation,sport connect F.C ,</i></p><p><i>3. Poster for Women in Business, an initiative of Kenya National Chamber of Commerce &amp; Industry</i></p><p><i>I did a poster for notification of nominations for the Women in Business Awards</i></p><p><i>4.Various posters for various clients</i></p>', 0, 1, '2018-01-07 11:46:46'),
