(902, 'Wasini Trip Videography and Photography', 'The trip to the Wasini-Shimoni Dolphin channel was truly epic for me. I can still see the Blue Ocean in my dreams. ', 'Cover the Wasini Trip with Video and Photography', '<p><span style=\"margin: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 14px; line-height: inherit; font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, Helvetica, Arial, sans-serif; vertical-align: baseline;\">The trip to the Wasini-Shimoni Dolphin channel was truly epic for me. I can still see the Blue Ocean in my dreams.&nbsp;</span></p><p><br style=\"font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, Helvetica, Arial, sans-serif; font-size: 14px;\"><span style=\"margin: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 14px; line-height: inherit; font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, Helvetica, Arial, sans-serif; vertical-align: baseline;\"><i><b>I got to walk on the same channels and sail on pretty much the same dhows that slaves of ancient times did almost 400 years ago. It felt like stepping back in time.&nbsp;</b></i></span></p><p><br style=\"font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, Helvetica, Arial, sans-serif; font-size: 14px;\"><span style=\"margin: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 14px; line-height: inherit; font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, Helvetica, Arial, sans-serif; vertical-align: baseline;\">They say the world is a book and those who don\'t travel read only one page.&nbsp;</span><br></p>', 0, 3, '2018-01-11 07:17:32'),
(903, 'Making Money online article', 'One of the highest-searched topics when it comes to making money is ‘how to make money online\'', 'Write a detailed blog on why making money online is not easy as it seems.', '<p name=\"5ed9\" id=\"5ed9\" class=\"graf graf--p graf-after--p\" style=\"margin-top: 29px; margin-bottom: 0px; --baseline-multiplier:0.17; font-family: medium-content-serif-font, Georgia, Cambria, &quot;Times New Roman&quot;, Times, serif; font-size: 21px; line-height: 1.58; letter-spacing: -0.003em; color: rgba(0, 0, 0, 0.84);\">The truth is, there are so many ways of making money online, and with this comes the challenge.</p><p name=\"92b9\" id=\"92b9\" class=\"graf graf--p graf-after--p\" style=\"margin-top: 29px; margin-bottom: 0px; --baseline-multiplier:0.17; font-family: medium-content-serif-font, Georgia, Cambria, &quot;Times New Roman&quot;, Times, serif; font-size: 21px; line-height: 1.58; letter-spacing: -0.003em; color: rgba(0, 0, 0, 0.84);\">For one, there is no one ‘perfect’ path to making it online. The challenge usually is taking one path and following it through to the end.</p><p name=\"92b9\" id=\"92b9\" class=\"graf graf--p graf-after--p\" style=\"margin-top: 29px; margin-bottom: 0px; --baseline-multiplier:0.17; font-family: medium-content-serif-font, Georgia, Cambria, &quot;Times New Roman&quot;, Times, serif; font-size: 21px; line-height: 1.58; letter-spacing: -0.003em; color: rgba(0, 0, 0, 0.84);\">Here is a piece I wrote about this subject&nbsp;<a href=\"https://medium.com/@davgit/why-making-a-living-online-is-not-easy-addd1611e4de\" target=\"_blank\"><b><i>Link to Medium</i></b></a></p><p name=\"92b9\" id=\"92b9\" class=\"graf graf--p graf-after--p\" style=\"margin-top: 29px; margin-bottom: 0px; --baseline-multiplier:0.17; font-family: medium-content-serif-font, Georgia, Cambria, &quot;Times New Roman&quot;, Times, serif; font-size: 21px; line-height: 1.58; letter-spacing: -0.003em; color: rgba(0, 0, 0, 0.84);\"><br></p>', 0, 3, '2018-01-11 07:25:31'),
(904, 'Omarion in Nairobi Video Coverage', 'This is a video I shot for the \'\'Omarion in Nairobi\'\' Concert that went down in Ngong Racecourse', 'Cover the event with Video Clips', '<p>Here are the links to the Video on Youtube ;-<br><a href=\"https://www.youtube.com/watch?v=A5S_P3J2xsU\"><b><i>Omarion in Nairobi Video</i></b></a></p><p><a href=\"https://www.youtube.com/watch?v=A5S_P3J2xsU\"><b><i><br></i></b></a><br></p>', 0, 4, '2018-01-11 07:36:25'),
(905, 'Nyama Mama Review Video', 'I was tasked with shooting a video for the review of the new Nyama Mama joint that opened up in Nairobi', 'Produce great quality video.', 'After working as a cook in exclusive Safari lodges around East & West Africa, Mama has gone back to her childhood roots preparing home-style dishes with a modern eclectic twist.\r\n\r\n \r\n\r\nNyama Mama is an unpretentious, fun, modern day African roadside diner. Locally inspired, some of our skilfully concocted dishes include Chapatti wraps to Mama’s stews and flavourful sides.\r\n\r\n \r\n\r\nIndulge in some nostalgia with our sharing platters and signature cocktails served in iconic metal Vikombe.\r\n\r\n \r\n\r\nNyama Mama Xpress is mama’s limited service diner, conveniently located in central locations delivering a dose of hearty mama’s food on the go.', 0, 3, '2018-01-11 07:45:58'),
(906, 'KFA Video shoot', 'This is a videoshoot I did for Kenya Fashion Awards.', 'Produce great quality video.', '<p>Here is the link to this video ;&nbsp;<a href=\"https://www.youtube.com/watch?v=wB-4V7o3x3E\" target=\"_blank\" style=\"background-color: rgb(255, 255, 255); color: rgb(114, 175, 210); outline: none;\"><span style=\"font-size: 18px;\"><b><i>Kenya Fashion Awards Video</i></b></span></a><br></p><p><br></p>', 0, 3, '2018-01-11 08:05:05');
