INSERT INTO `services` (`id`, `title`, `description`, `location`, `objectives`, `price`, `approved`, `published`, `created`) VALUES
(1, 'Get a Logo at 3000', 'I will design and create a logo according to your requirements.', 'Anywhere', 'Output format will be PNG and JPEG with two examples of how it looks on branded merchandise.\r\nTwo revisions are available after the first draft to polish up on your final requirements.\r\nFull project file and final logo images supplied to you on payment completion (it will be watermarked before payment is complete).\r\nAvailable immediately and from any location. No need to meet physically.', '3000', 1, 2, '2018-01-01 22:18:01'),
(2, 'Design of posters', 'I can design professional  looking posters for your business .', 'Nairobi ', '', '2500', 0, 4, '2018-01-05 07:48:37'),
(3, 'Product photography', 'I will do professional product photography for you with all images fully edited and retouched.', 'Anywhere', '', '3500', 0, 3, '2018-01-05 18:12:43'),
(4, 'Studio photography', 'I will do photography for you that involves a studio.', 'Nairobi', '<p>Are you looking to have the following:</p><ol><li>Portraits</li><li>Graduation photography</li><li>Baby Bumbs</li><li>Editorial photography</li><li>Concept photography</li><li>Artistic photography</li><li>Engagement photography</li><li>Family photography</li></ol><p>I can offer these types of photography in a studio or a venue of your choice at an affordable price.</p><p>Have a look at some of my work in my profile,drop me a line if you have any inquiries.</p>', '2000', 0, 3, '2018-01-05 18:29:53'),
(5, 'Mobile App Development', 'I will  create a modern design for your mobile app', 'Anywhere', '<p><span style=\"color: rgb(14, 14, 15); font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\">Do you have an idea for an app?</span><br style=\"color: rgb(14, 14, 15); font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\"><span style=\"color: rgb(14, 14, 15); font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\">Or maybe you already have an app but you want it to have better user experience?</span></p><p><span style=\"color: rgb(14, 14, 15); font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\"><br></span><span style=\"background-color: transparent; color: rgb(14, 14, 15); font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\">If you already outlined your app idea on a piece of paper or any other method - you are more than welcome to hire me to turn your idea into a beautiful, modern and contemporary design - the one you deserve.</span></p><p><span style=\"background-color: transparent; color: rgb(14, 14, 15); font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\"><br></span><span style=\"background-color: transparent; color: rgb(14, 14, 15); font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\">If you haven\'t sketched anything yet and you need help with getting the idea out, that\'s cool, we can talk and see how to approach your idea using a \"customized pack\".</span></p><p><span style=\"background-color: transparent; color: rgb(14, 14, 15); font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\"><br></span><span style=\"background-color: transparent; color: rgb(14, 14, 15); font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\">I would love to help you with your venture, just like I helped many others (and still do).</span></p><p><span style=\"background-color: transparent; color: rgb(14, 14, 15); font-