(7, 'Responsive websites', 'I Will Build You A Stunning Website for your business\r\n', 'Anywhere', '<p><span style=\"color: rgb(14, 14, 15); font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\">With my small team,we design and build beautiful websites, always including&nbsp;<span style=\"font-weight: 700;\"><i>complete SEO, Google Analytics setup, seamless connection to your social media channels,</i></span>&nbsp;and complete tutorials for those who want to maintain their websites themselves.</span></p><p><span style=\"color: rgb(14, 14, 15); font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\">Not into the day-to-day? Moving forward,we offer maintenance packages as well! We pride ourselves on our full-service, client-centered philosophy and practice.</span></p><p><span style=\"color: rgb(14, 14, 15); font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\">Whether you need a beautiful new eCommerce site, a compelling vision for your non-profit, or an enticingly stunning online presence for your restaurant or hotel, we will make it so.</span></p>', '70000', 0, 4, '2018-01-05 20:56:40'),
(8, 'Event photography', 'I will produce high quality photos and video for your next event', 'Anywhere', 'Are you or any of your immediate family members part of an organization or club?Do they have any big events that they feature regularly or annually? \n\nYou have come to the right place.Whether its photographing a political dinner, a church bazaar, a birthday party, or an awards event,our group of photographers got you covered.', '50000', 0, 3, '2018-01-05 21:23:37'),
(9, 'Pencil portraits', 'I will transform your simple picture into an amazing work of art.', 'Anywhere', '<p><br></p><div style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; color: rgb(14, 14, 15); font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\">I\'ll draw a realistic portrait answering your wishes and requirements and add a simple background if you like.</div><div style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; color: rgb(14, 14, 15); font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\"><br></div><div style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; color: rgb(14, 14, 15); font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\">To start the illustration, I just need some reference photos and your briefing.</div><div style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; color: rgb(14, 14, 15); font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\"><br></div><div style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; color: rgb(14, 14, 15); font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\">The final drawing will meet your expectations. In addition I can also include my illustration to a background that you already have or add any graphic element to better represent the character or story you are trying to tell.</div><div style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; color: rgb(14, 14, 15); font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\"><br>The final drawing will meet your expectations. My work is traditional drawing adapted to new media. The result is a high resolution image by a professional artist - it will be ideal for printing in high quality.&nbsp;<br><br>Don\'t hesitate to message me if you have some questions or want more informations about the gig.&nbsp;<br><br>Looking forward to hear from you!</div>', '16000', 0, 2, '2018-01-05 21:35:54'),
