(11, 'Get a website at 15000', 'I will make a great website for you.', 'Nairobi, Kenya', '<p>Get a website in 3 days</p>', '15000', 0, 2, '2018-01-06 07:32:45'),
(12, 'Modelling Photography', 'I will produce amazing photos for your modelling gig', 'Anywhere', '<p><span style=\"color: rgb(34, 34, 34); font-family: Publico, Times, &quot;Times New Roman&quot;, serif; font-size: 17px;\">If you are a new model just starting out, or even a model with experience who is looking to expand your representation to bigger markets, you are likely thinking about submitting your photos to agencies for review.</span></p><p><span style=\"color: rgb(34, 34, 34); font-family: Publico, Times, &quot;Times New Roman&quot;, serif; font-size: 17px;\">I will give you fully edited photos that will wow agents.</span></p>', '3500', 0, 4, '2018-01-06 08:28:35'),
(14, 'Social Media Marketing', 'I will make your brand stand out on social  media', 'Anywhere', '<p>I run <b>Protohouse LTD</b>, a creative agency based in Nairobi,Kenya.</p><p><b>Protohouse management </b>encompasses building your <i><b>brand,\r\nloyalty, customer base </b></i>and much more. Protohouse offers\r\nhighly customized <i><b>B2B social media marketing management\r\nservices</b></i> that help companies of all sizes with their ongoing\r\nsocial media marketing needs. </p><p>With your best interests in\r\nmind, we can create an <i><b>affordable social media plan</b></i> that\r\nbegins with us learning your business and ends with your\r\nsatisfaction over the growth of your business.&nbsp;</p><p><b><u>What you will get.</u></b></p><ol><li><u style=\"font-weight: bold;\">Monitoring</u>&nbsp;- Protohouse Digital’s fast search and analytical capabilities help\r\nyou remain agile and informed at the speed of social. With\r\nunlimited searches and customizable dashboards, you can identify\r\ntop trends and perceptions about your brand quickly and track the\r\ncompetition so you can make informed business decisions.</li><li><u style=\"font-weight: bold;\">Analytics-</u>&nbsp;Understand the drivers, key influencers, and segments initiating\r\nconversations about your products and services. Protohouse Digital\r\nhas powerful social media analytics, available as a core component\r\nof the platform at no additional charge, to help you gather deep\r\ncustomer insights.</li><li><u style=\"font-weight: bold;\">Engagement&nbsp;</u>&nbsp;-&nbsp;With corporate social media presence on outlets including Twitter,\r\nFacebook and YouTube, consumers are expecting companies to listen\r\nto them and respond online. With actionable Social Intelligence\r\nfrom Protohouse Digital and the ability for prompt and direct\r\nconsumer engagement online, companies can strengthen service\r\nand support, retain customers, resolve issues, and continue building\r\nbrand loyalty.</li></ol><p><b>Kindly get in touch with us before you place your order.</b></p>', '30000', 0, 5, '2018-01-08 06:41:40'),
(15, 'Mobile App Development', 'I will build an interactive mobile app for your business.', 'Anywhere', '<p>I will Develop intuitive Applications that drive more engagement,\r\nhelp spread awareness, increase fan participation or align with your\r\nobjectives for your customers.</p><p>Drop me a line on what kind of app you need build.</p>', '50000', 0, 3, '2018-01-08 06:52:17'),
(16, 'Graphic Design and Visuals', 'I will build a great brand identity for your business', 'Anywhere', '<p>Building a great brand requires a great brand experience and identity.This calls for powerful visuals that communicate your product/service to the prospect customer.</p><p><b><u>With us,here is what you will get.</u></b></p><ul><li>Poster Design</li><li>Logo Design</li><li>Social Media Graphics</li><li>Print management&nbsp;</li><li>T-shirts Design</li><li>Branded drinkware</li><li>Branded apparell</li><li>Branded officeware</li></ul><p><b>For more details and price inquiry,get in touch with us in Onesha Messaging to help you in your next task.</b></p><p><br></p>', '5000', 0, 3, '2018-01-08 07:06:23'),
(17, 'Photography and Video Coverage', 'I will produce great photographs for your product', 'Kenya', '<p>Looking for a professional photographer? Through our talented roster of&nbsp; professional photographers,you will get the following photography services.</p><ul><li>Brand photography for Advertising,Collateral,Core posters and Assets.</li><li>Real Estate and Architecture photography</li><li>Product and Service photography</li><li>Web ready photography</li><li>Event photography</li><li>Corporate photography</li><li>Album artwork</li><li>Professional portraits<br><br><b>Get in touch with us for more inquiry for your next task.</b></li></ul>', '10000', 0, 4, '2018-01-08 07:14:51'),
(18, 'Outdoor Photography', 'I will do great outdoor photography for you', 'Kenya', '<p>Are you looking to have the <a href=\"following:_\">following:_</a></p><ul><li>Engagement shoot</li><li>Travel shoot</li><li>Landscape shoot</li><li>Family gathering</li><li>Graduation shoot</li><li>Picnic shoots<br><br><b>Get in touch with us to help you with your next task.</b></li></ul>', '4000', 0, 4, '2018-01-08 07:52:22'),
(19, 'Photography services', 'I will do any kind of photography for you and your business.', 'Kenya', '<p>Are you Shooting your next video?Do you need a babybumb shoot?What about that engagement you want with your partner,well,my team has vast experience in these areas in additions to the ones listed below.</p><ol><li>Outdoor photography</li><li>Studio photography</li><li>Modelling photography</li><li>Runway shoots</li><li>Product photography</li><li>Video coverage</li><li>Professional retouch</li><li>Landscape photography</li><li>Architecture photography</li></ol><p><b>Get in touch with us and let us know how we can help you in your next task.</b></p>', '10000', 0, 3, '2018-01-08 10:01:03'),
(21, 'Videography services', 'I will produce great video content for your next event.', 'Kenya', '<p>Are you looking to have your next event covered in video.Look no further,we got you covered.<br></p><p>We cover the <a href=\"following:-\">following:-</a></p><ol><li>Weddings</li><li>Fashion Runways</li><li>Corporate launches</li><li>Gala Dinners</li><li>Hikes</li><li>Night events</li><li>Club life</li><li>Documentaries</li><li>Editorial</li></ol><p>Links to our Various <a href=\"Works:-\">Works:-</a></p><p>Trip to Wasin-&nbsp;<a href=\"http://bit.ly/2Ev9ZGc\">http://bit.ly/2Ev9ZGc</a><a href=\"http://bit.ly/2Ev9ZGc\"></a></p><p><a href=\"https://medium.com/@davgit/why-making-a-living-online-is-not-easy-addd1611e4de\" target=\"_blank\" data-saferedirecturl=\"https://www.google.com/url?hl=en&amp;q=https://medium.com/@davgit/why-making-a-living-online-is-not-easy-addd1611e4de&amp;source=gmail&amp;ust=1515735942924000&amp;usg=AFQjCNEkPyNo6Y9Kd6onqSQj9FKIGqMh3g\" style=\"color: rgb(17, 85, 204); font-family: arial, sans-serif; font-size: 12.8px; background-color: rgb(255, 255, 255);\">Why Making a Living Online is Not Easy</a></p><p><a href=\"https://www.youtube.com/watch?v=A5S_P3J2xsU\" target=\"_blank\" data-saferedirecturl=\"https://www.google.com/url?hl=en&amp;q=https://www.youtube.com/watch?v%3DA5S_P3J2xsU&amp;source=gmail&amp;ust=1515735942925000&amp;usg=AFQjCNGa_p0p6v07m52Tb0YTaWuQiSk5ew\" style=\"color: rgb(17, 85, 204); font-family: arial, sans-serif; font-size: 12.8px; background-color: rgb(255, 255, 255);\">Omarion Performing Live in Nairobi, Kenya</a></p><div style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px;\"><a href=\"https://www.instagram.com/p/Bb_pfJ2Hl97/?taken-by=adeledejak\" target=\"_blank\" data-saferedirecturl=\"https://www.google.com/url?hl=en&amp;q=https://www.instagram.com/p/Bb_pfJ2Hl97/?taken-by%3Dadeledejak&amp;source=gmail&amp;ust=1515735942925000&amp;usg=AFQjCNEhAuWiiSvk9PYX_tZpSpZdi84j5w\" style=\"color: rgb