(22, 'Photography services', 'I will produce great shots for your  business/personal', 'Kenya', '<p><span style=\"color: rgb(18, 18, 18); font-family: Proxima-Nova, serif; font-size: 18px;\">They say a picture is worth a thousand words. But I wonder,how else can this be true if you don\'t hire a pro.</span></p><p><span style=\"color: rgb(18, 18, 18); font-family: Proxima-Nova, serif; font-size: 18px;\">I believe that When words become unclear, I shall focus with photographs. When images become inadequate, I shall be content with silence.</span></p><p><span style=\"color: rgb(18, 18, 18); font-family: Proxima-Nova, serif; font-size: 18px;\">What kind of photography do we offer?</span></p><ul><li><span style=\"color: rgb(18, 18, 18); font-family: Proxima-Nova, serif; font-size: 18px;\">Event photography</span></li><li><span style=\"color: rgb(18, 18, 18); font-family: Proxima-Nova, serif; font-size: 18px;\">Music Shoots</span></li><li><span style=\"color: rgb(18, 18, 18); font-family: Proxima-Nova, serif; font-size: 18px;\">Portraits</span></li><li><span style=\"color: rgb(18, 18, 18); font-family: Proxima-Nova, serif; font-size: 18px;\">Product photography</span></li><li><span style=\"color: rgb(18, 18, 18); font-family: Proxima-Nova, serif; font-size: 18px;\">Studio photography</span></li><li><span style=\"color: rgb(18, 18, 18); font-family: Proxima-Nova, serif; font-size: 18px;\">Editorial</span></li><li><span style=\"color: rgb(18, 18, 18); font-family: Proxima-Nova, serif; font-size: 18px;\">Babybumps<br><br>Get in touch with me via Onesha and let us talk more about your next task.</span></li></ul>', '10000', 0, 4, '2018-01-11 06:33:17'),
