(40, 'Branded Business proposal', 'I will work with you to designed a branded business proposal to help you close your next deal', 'Anywhere', '<p><b>Think a brand is just for big businesses? Think again. Branding is critical for businesses of all shapes and sizes.</b></p><p>Branding can be a daunting task for small businesses and it’s easy to \r\nthink brands are reserved for the Nikes and Coca-Colas of the world. But\r\n branding is even more important if you’re a small business.</p><p>I will do business proposal branding in the following <a href=\"areas:-\">areas:-</a></p><ol><li>Web design</li><li>Built environment</li><li>Public Relations</li><li>Marketing</li><li>Digital strategy</li><li>Human resource</li><li>Private equity</li></ol><p><b><i>Get in touch with me to get a customizable quote and a tailored service for your next business proposal.</i></b><br></p><p><br></p><p><br></p>', '3000-10000', 0, 1, '2018-01-24 13:02:40'),
