(44, 'Digital Marketing', 'I will give you the best online presence through facebook, twitter and instagram ', 'Anywhere', '<p><b><span style=\"font-size:44pt;\"><span style=\"font-family: &quot;Calibri Light&quot;; font-size: 18px;\">What I Do &nbsp;to help Business grow on social Media</span></span><span style=\"font-size: 18px;\">&nbsp;</span></b></p><p style=\"line-height:90%;margin-top:10pt;margin-bottom:0pt;margin-right:0pt;margin-left:18pt;text-indent:-18pt;\"><span style=\"font-size: 28pt;\"><span style=\"font-family: Arial; font-size: 12px;\">•<span style=\"font-size: 14px;\">	</span></span></span><span style=\"font-size:28pt;\"><span style=\"font-family: Calibri; font-size: 14px;\">Daily management of posts </span></span></p><p style=\"line-height:90%;margin-top:10pt;margin-bottom:0pt;margin-right:0pt;margin-left:18pt;text-indent:-18pt;\"><span style=\"font-size: 28pt;\"><span style=\"font-family: Arial; font-size: 14px;\">•	</span></span><span style=\"font-size:28pt;\"><span style=\"font-family: Calibri; font-size: 14px;\">Interactive engagement</span></span></p><p style=\"line-height:90%;margin-top:10pt;margin-bottom:0pt;margin-right:0pt;margin-left:18pt;text-indent:-18pt;\"><span style=\"font-size: 28pt;\"><span style=\"font-family: Arial; font-size: 14px;\">•	</span></span><span style=\"font-size:28pt;\"><span style=\"font-family: Calibri; font-size: 14px;\">Custom content creation </span></span></p><p style=\"line-height:90%;margin-top:10pt;margin-bottom:0pt;margin-right:0pt;margin-left:18pt;text-indent:-18pt;\"><span style=\"font-size: 28pt;\"><span style=\"font-family: Arial; font-size: 14px;\">•	</span></span><span style=\"font-size:28pt;\"><span style=\"font-family: Calibri; font-size: 14px;\">Provide quick response to customers or clients </span></span></p><p style=\"line-height:90%;margin-top:10pt;margin-bottom:0pt;margin-right:0pt;margin-left:18pt;text-indent:-18pt;\"><span style=\"font-size: 28pt;\"><span style=\"font-family: Arial; font-size: