(45, 'Custom Made designs', 'We will help you custom design blazers, suits, wedding gowns and anything in between for your next event/occasion/date', 'Kenya', '<p>Taisere Designs works with you to help you look great and dope, whether you going for a business meeting, a corporate event, dinner with friends or your big day.</p><p><b><span style=\"font-size: 18px;\">Get in touch with us by clicking the \'\'Get Service\'\' for a custom quote.</span></b></p>', '5000-20000', 0, 5, '2018-02-06 06:42:04'),
