(47, 'Deejaying services', 'I will electrify your next event with great music.', 'Kenya', '<p>I offer my deejay services in these places.</p><ol><li>Events</li><li>Clubs</li><li>Corporate functions</li><li>Schools</li><li>Wedding receptions</li><li>Private parties</li></ol><p><b>Get in touch via \'\'Get Service\'\' for a&nbsp; quote</b></p>', '20000-10000', 0, 4, '2018-02-10 10:12:53'),
