(53, 'Studio photography', 'I will  produce great shots for you.', 'Anywhere', '<p><span style=\"color: rgb(84, 84, 84); font-family: arial, sans-serif; font-size: small;\">Our full-</span><span style=\"font-weight: bold; color: rgb(106, 106, 106); font-family: arial, sans-serif; font-size: small;\">service studios</span><span style=\"color: rgb(84, 84, 84); font-family: arial, sans-serif; font-size: small;\">&nbsp;offer a wide variety of portrait&nbsp;</span><span style=\"font-weight: bold; color: rgb(106, 106, 106); font-family: arial, sans-serif; font-size: small;\">services</span><span style=\"color: rgb(84, 84, 84); font-family: arial, sans-serif; font-size: small;\">, including newborn photos, graduation portraits, wedding&nbsp;</span><span style=\"font-weight: bold; color: rgb(106, 106, 106); font-family: arial, sans-serif; font-size: small;\">photography</span><span style=\"color: rgb(84, 84, 84); font-family: arial, sans-serif; font-size: small;\">, family photos, and more! </span></p><p><span style=\"color: rgb(84, 84, 84); font-family: arial, sans-serif; font-size: small;\">No matter what occasion you and your family are celebrating, our team of expert&nbsp;</span><span style=\"font-weight: bold; color: rgb(106, 106, 106); font-family: arial, sans-serif; font-size: small;\">photographers</span><span style=\"color: rgb(84, 84, 84); font-family: arial, sans-serif; font-size: small;\">&nbsp;and helpful&nbsp;</span><span style=\"font-weight: bold; color: rgb(106, 106, 106); font-family: arial, sans-serif; font-size: small;\">studio</span><span style=\"color: rgb(84, 84, 84); font-family: arial, sans-serif; font-size: small;\">&nbsp;associates are here to help you.</span></p><p><b><span style=\"font-size: 18px;\">Get in touch with us to get a more customized quote</span></b></p><p><br></p>', '2000-20000', 0, 4, '2018-02-19 10:38:48'),
