(58, 'Motion Graphics', 'I will create short animation graphics video for your brand.', 'Anywhere', '<p>A great motion graphics video is a great tool to catch a viewers eye.Whether its a sale you want to promote, a short commercial or just a few words about your business.</p><p>For this service, you will get the <a href=\"following:-\">following:-</a></p><ul><li>Video editing.</li><li>Background music</li><li>product imagery</li><li>Script writing</li><li>Voice Over</li><li>20 seconds run</li></ul><p><b><i>Get in touch to get a more customized quote on this service, you project is waiting.</i></b></p>', '20000-90000', 0, 4, '2018-02-24 12:57:28'),
