(1, 'Official Profile of the Onesha Admin. We run the largest e-portfolio platform for #creative professionals all over Africa to #showcase their best work. Contact us for any issues, compliments and complaints. \n<br>\nYou can find us on:  <br> Facebook - @oneshaKE <br>\nTwitter - @onesha_KE <br>\nInstagram - @onesha_KE. <br>\n\nOnesha is managed by the Briglobe Team.', '0712983630', '0000-00-00', 'Kenya'),
(5, 'In all I do', '0700 000 002', '2017', 'Kenya'),
